import React from 'react' 

function Agency()
{
    return(<>
         <div className="container-fluid m-1 p-1  " style={{backgroundColor:' #232933'}}>
                 <h2 className="text-center font web p-1 ">AGENCY</h2>
                 <p className="content-justify p-1 text-white">An agency, in broad terms, is any relationship between two parties in which one, the agent, represents the other, the principal, in day-to-day transactions. The principal or principals have hired the agent to perform a service on their behalf. ... By definition, an agent is using the resources of a principal.
                       <img src="https://bit.ly/3uoshCr" style={{width:'70%' , height:'300px', padding:'5px'}}/>
                 </p>
         </div>
    </>)
}

export default  Agency;
